import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 24.2-414 Final registration day.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-414.md","filePath":"vacode/24.2-414.md"}'),i={name:"vacode/24.2-414.md"},o=t('<h1 id="§-24-2-414-final-registration-day" tabindex="-1">§ 24.2-414 Final registration day. <a class="header-anchor" href="#§-24-2-414-final-registration-day" aria-label="Permalink to &quot;§ 24.2-414 Final registration day.&quot;">​</a></h1><p>Each general registrar shall hold a final day of registration on the day before the registration records close under § <a href="http://law.lis.virginia.gov/vacode/24.2-416/" target="_blank" rel="noreferrer">24.2-416</a> for every election held in his jurisdiction. On the final day of registration, the principal office of the general registrar shall be open a minimum of eight hours. The registrar shall make a list by name of any persons in line at the time of closing and shall permit those persons to complete an application to register or to make any necessary changes to their registration records.</p><p>Code 1950, §§ 24-74 through 24-76, 24-78; 1963, Ex. Sess., c. 2; 1970, c. 462, § 24.1-49; 1975, c. 515; 1976, c. 616; 1984, c. 480; 1985, c. 530; 1988, c. 305; 1989, c. 743; 1991, cc. 42, 136; 1993, cc. 545, 619, 641; 2001, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0613" target="_blank" rel="noreferrer">613</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0632" target="_blank" rel="noreferrer">632</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0424" target="_blank" rel="noreferrer">424</a>.</p>',3),n=[o];function s(l,c,h,g,d,f){return a(),r("div",null,n)}const m=e(i,[["render",s]]);export{p as __pageData,m as default};
